import styled from 'styled-components'

const HomeContainer = styled.div`
  display: flex;
`

const PostContainer = styled.div`
  width: 650px;
  padding: 1rem;
`

const Aside = styled.div`
  width: 350px;
  padding: 1rem;
`

class Home extends React.Component {
  render() {
    return (
      <HomeContainer>
        <PostContainer />
        <Aside />
      </HomeContainer>
    )
  }
}

export default Home
